INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES ("2030/01/01 14:59:59", 1, 5, 0.0, "2025/01/31 12:00:00", 2, 2.12, 190801, -363.0, "カリン", 1000005, "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", 1, 64);
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES ("2030/01/01 14:59:59", 1, 6, 0.0, "2025/01/31 12:00:00", 1, 1.68, 190801, -363.0, "カリン", 1000006, "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ", 2, 64);
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES ("2030/01/01 14:59:59", 1, 7, 0.0, "2025/01/31 12:00:00", 2, 2.33, 190801, -363.0, "カリン", 1000007, "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", 1, 64);
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES ("2030/01/01 14:59:59", 10201, 101, -6.0, "2025/01/31 12:00:00", 3, 5.18, 133701, -285.0, "ラビリスタ", 1020101, "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", 7, 61);
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES ("2030/01/01 14:59:59", 10201, 201, -2.0, "2025/01/31 12:00:00", 1, 8.77, 133901, -285.0, "クリスティーナ", 1020102, "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", 2, 61);
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES ("2030/01/01 14:59:59", 10201, 301, 0.0, "2025/01/31 12:00:00", 6, 15.5, 133801, -285.0, "ネネカ", 1020103, "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 1, 61);
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES ("2030/01/01 14:59:59", 10202, 101, 0.0, "2025/02/28 12:00:00", 2, 9.061, 134301, -285.0, "ランファ", 1020201, "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", 5, 61);
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES ("2030/01/01 14:59:59", 10202, 201, 0.0, "2025/02/28 12:00:00", 1, 7.699, 134401, -285.0, "チカ", 1020202, "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", 2, 61);
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES ("2030/01/01 14:59:59", 10203, 101, 0.0, "2025/03/31 12:00:00", 1, 8.595, 134601, -285.0, "アオイ", 1020301, "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", 2, 61);
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES ("2030/01/01 14:59:59", 10203, 201, 0.0, "2025/03/31 12:00:00", 1, 7.758, 134501, -285.0, "クローチェ", 1020302, "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", 2, 61);
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES ("2030/01/01 14:59:59", 10204, 101, 0.0, "2025/04/30 12:00:00", 2, 7.0, 132302, -285.0, "ルイズマリー", 1020401, "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", 6, 61);
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES ("2030/01/01 14:59:59", 10204, 201, 0.0, "2025/04/30 12:00:00", 1, 7.904, 132402, -285.0, "イロハ", 1020402, "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", 2, 61);
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES ("2030/01/01 14:59:59", 10204, 301, 0.0, "2025/04/30 12:00:00", 4, 8.487, 132502, -285.0, "ソノ", 1020403, "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", 2, 61);
